import Header from "./components/Header";
import Footer from "./components/Footer";
import Game from "./components/Game";

const App = () => {
  return (
    <div className='container'>
      <Header title= 'Welcome'/>
      <Game />
      <Footer />
    </div>
  );
}

export default App;
